import React from 'react';
import './Main.css';
import {Posts} from '../Posts/PostsList'
import {EditPost} from '../Posts/EditPost'
import {Route} from 'react-router-dom'


function Main() {
  return (
    <div className="Main">
      <Route path='/' component ={Posts} />
       <Route path='/addPosts' component={EditPost}/>
       
    </div>
  );
}

export default Main;
